import React from "react";

function Card(porps) {
  return (
    <div className="card" style={{ width: "18rem" }}>
      <div className="card-body">
        <h5 className="card-title">{porps.title}</h5>
        <h6 className="card-subtitle mb-2 text-body-secondary">{porps.company}</h6>
        <a href="#{job.location}" className="card-link">{porps.location}</a>
      </div>
    </div>
  );
}

export default Card;
